.boxB {
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  margin: auto;
  width: 5.5rem;
  height: 3.4rem;
  /* transform: translate(-50%,-50%); */
  animation: show 1s;
  z-index: 55;
}

.boxB .top {
  width: 100%;
  height: 0.8rem;
  background: #c12f3e;
  border-top-left-radius: 0.2rem;
  border-top-right-radius: 0.2rem;
  position: relative;
}

.boxB .top img {
  position: absolute;
  width: 4.36rem;
  height: 0.92rem;
  left: 0;
  top: -0.1rem;
  right: 0;
  bottom: 0;
  margin: auto;
}

.boxB .bottom {
  width: 100%;
  border-bottom-left-radius: 0.2rem;
  border-bottom-right-radius: 0.2rem;
  background: #f3f3f3;
  font-size: 0.3rem;
  text-align: center;
  color: #4d4d4d;
  padding-top: 0.36rem;
}

.di {
  width: 100%;
  border-top: 1px solid #d8d8d8;
  padding: 0.37rem 0 0.34rem 0;
}

.di span {
  display: inline-block;
  width: 2.1rem;
  height: 0.6rem;
  border-radius: 0.4rem;
  text-align: center;
  line-height: 0.6rem;
  font-size: 0.24rem;
  color: #fff;
  box-shadow: 1px 3px 6px #d8d8d8;
}
